        <li className="nav-item"><Link to="/documentation" className="nav-link btn btn-secondary text-white px-3">Documentation</Link></li>
        <Link to="/" className="nav-link" onClick={() => {localStorage.removeItem("token"); localStorage.removeItem("user");}} >Se d√©connecter</Link>
    </ul>  

  );
};

